webpackJsonp([0xac9bf4262af4],{1166:function(e,a){e.exports={data:{nodePost:{title:"Sometimes a Recruiter Reminds You That Your Pet Died",body:{value:'<p>I\'ve got some good news and some bad news recruiter.  Good news: you got my attention by reading the <a href="/about">about page</a> on my website and using the subject line "Update on the Fish." Bad news: by asking "I noticed from the portfolio that you have (currently) two fish - is this up to date??" I now have to regretfully inform you that one of my fish has died. Related question: do you have any connections with people who are able to keep fish alive?</p>'},relationships:{image:{localFile:{childImageSharp:{sizes:{base64:"data:image/png;base64,",aspectRatio:3.2072072072072073,src:"/static/d206ce5a5b007d84429b322ce64854ac-27cacea5ff97de3e34ae105fff647204-c3df5.png",srcSet:"/static/d206ce5a5b007d84429b322ce64854ac-27cacea5ff97de3e34ae105fff647204-27394.png 313w,\n/static/d206ce5a5b007d84429b322ce64854ac-27cacea5ff97de3e34ae105fff647204-8aa64.png 625w,\n/static/d206ce5a5b007d84429b322ce64854ac-27cacea5ff97de3e34ae105fff647204-c3df5.png 712w",sizes:"(max-width: 712px) 100vw, 712px"}}}}},created:1529685456}},pathContext:{slug:"/post/sometimes-a-recruiter-reminds-you-that-your-pet-died/"}}}});
